import React from 'react';
import {useState} from 'react';

function App() {

  const [user,setUser] = useState([]);

  const getFetch = () => {
   try {
    const data = "http://localhost:8080/sign/all";
    fetch(data)
      .then(result => {
        let content = result.json();
        setUser([...content]);
      })
      .catch(err => console.log(err));
   } catch (error) {
      console.log(error);
   }
  }

  getFetch();

  return (
    <div>
      {user}
    </div>
  )
}

export default App
